import SlidingBox from './header-slidingBox/header-slidingBox'
import styles from './header.module.scss'
import Titele from './header-titele/header-titele'
export interface HeaderProps {
    status?: 'default' | 'mobail'
}

export default function Header({ status = 'default' }: HeaderProps) {

    return <div className={styles['header__' + status]} >
        <Titele status={status}></Titele>
        <SlidingBox></SlidingBox>
    </div>
}
